import React from 'react';
import { Card, Table, Button } from 'react-bootstrap';

const TodayLog = ({ foodEntries, onAddFood }) => {
    return (
        <Card className="mb-4">
            <Card.Header>Today's Log</Card.Header>
            <Card.Body>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>Food Name</th>
                            <th>Serving Size</th>
                        </tr>
                    </thead>
                    <tbody>
                        {foodEntries.map((entry, index) => (
                            <tr key={index}>
                                <td>{entry[0]}</td>
                                <td>{entry[1]}</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
                <Button variant="primary" onClick={onAddFood}>Add Food</Button>
            </Card.Body>
        </Card>
    );
};

export default TodayLog;
